protected void Page_Load(object sender, EventArgs e)\n{\n    if (!IsPostBack)\n    {\n        // Create a simple HTML table and populate it\n        string tableHtml = "<table border='1'>";\n        tableHtml += "<tr><th>Header 1</th><th>Header 2</th></tr>";\n\n        for (int i = 0; i < 5; i++)\n        {\n            tableHtml += $"<tr><td>Data {i} - Cell 1</td><td>Data {i} - Cell 2</td></tr>";\n        }\n\n        tableHtml += "</table>";\n\n        // Set the HTML to Literal control\n        HtmlTable.Text = tableHtml;\n    }\n}